import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, Badge, Box, IconButton } from '@mui/material';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import MenuIcon from '@mui/icons-material/Menu';
import { logout } from '../../store/slices/authSlice';
import { Drawer, List, ListItem, ListItemText } from '@mui/material';
import { useState } from 'react';
import { useTheme, useMediaQuery } from '@mui/material';

const Header = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { user } = useSelector((state) => state.auth);
  const { items } = useSelector((state) => state.cart);
  const [mobileOpen, setMobileOpen] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  const handleLogout = () => {
    dispatch(logout());
    navigate('/login');
  };

  const menuItems = (
    <>
      <Button color="inherit" component={RouterLink} to="/products">
        Products
      </Button>
      <Button color="inherit" component={RouterLink} to="/cart">
        <Badge badgeContent={items.length} color="secondary">
          <ShoppingCartIcon />
        </Badge>
      </Button>
      {user ? (
        <>
          <Typography variant="body1" sx={{ display: { xs: 'none', sm: 'block' } }}>
            Welcome, {user.name}
          </Typography>
          <Button color="inherit" onClick={handleLogout}>Logout</Button>
        </>
      ) : (
        <>
          <Button color="inherit" component={RouterLink} to="/login">Login</Button>
          <Button color="inherit" component={RouterLink} to="/register">Register</Button>
        </>
      )}
    </>
  );

  return (
    <AppBar position="sticky" sx={{ mb: 4 }}>
      <Toolbar>
        {isMobile && (
          <IconButton
            color="inherit"
            edge="start"
            onClick={() => setMobileOpen(!mobileOpen)}
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
        )}
        <Typography 
          variant="h6" 
          component={RouterLink} 
          to="/" 
          sx={{ 
            flexGrow: 1, 
            textDecoration: 'none', 
            color: 'inherit',
            fontWeight: 'bold'
          }}
        >
          E-Commerce
        </Typography>
        {!isMobile ? (
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
            {menuItems}
          </Box>
        ) : (
          <Drawer
            anchor="left"
            open={mobileOpen}
            onClose={() => setMobileOpen(false)}
          >
            <Box sx={{ width: 250 }} onClick={() => setMobileOpen(false)}>
              <List>
                <ListItem component={RouterLink} to="/products">
                  <ListItemText primary="Products" />
                </ListItem>
                <ListItem component={RouterLink} to="/cart">
                  <ListItemText primary="Cart" />
                </ListItem>
                {user ? (
                  <>
                    <ListItem>
                      <ListItemText primary={`Welcome, ${user.name}`} />
                    </ListItem>
                    <ListItem button onClick={handleLogout}>
                      <ListItemText primary="Logout" />
                    </ListItem>
                  </>
                ) : (
                  <>
                    <ListItem component={RouterLink} to="/login">
                      <ListItemText primary="Login" />
                    </ListItem>
                    <ListItem component={RouterLink} to="/register">
                      <ListItemText primary="Register" />
                    </ListItem>
                  </>
                )}
              </List>
            </Box>
          </Drawer>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Header;
